CREATE TABLE mytable(
   Club_Advisor_Form                               VARCHAR(30) 
  ,Club_Constitution                               VARCHAR(30)
  ,Club_Name                                       VARCHAR(48) NOT NULL PRIMARY KEY
  ,days                                             VARCHAR(10)
  ,Room                                            VARCHAR(15)
  ,Presidents_First_Name                           VARCHAR(18)
  ,Presidents_Last_Name                            VARCHAR(16)
  ,Presidents_Bronx_Science_Email                  VARCHAR(39)
  ,CoPresidentVice_Presidents_First_Name           VARCHAR(14)
  ,CoPresidentVice_Presidents_Last_Name            VARCHAR(15)
  ,CoPresidentsVice_Presidents_Bronx_Science_Email VARCHAR(30)
  ,Secretarys_First_Name                           VARCHAR(15)
  ,Secretarys_Last_Name                            VARCHAR(16)
  ,Secretarys_Bronx_Science_Email                  VARCHAR(30)
  ,Advisor_Names                                   VARCHAR(24)
  ,Advisors_Bronx_Science_Emails                   VARCHAR(43)
);

SELECT * FROM mytable;

